query:
SELECT ?osmid ?distance ?loc ?tag WHERE {

  ?osmid osmt:newstuff ?tag . 
  SERVICE wikibase:around { 
      ?osmid osmm:loc ?loc . 
      bd:serviceParam wikibase:center "Point(12.760004 50.704369)"^^geo:wktLiteral . 
      bd:serviceParam wikibase:radius "15" . 
      bd:serviceParam wikibase:distance ?distance .
  } 
  FILTER(?distance < 15)
}
